import React, { Component } from 'react'
import PropTypes from 'prop-types'
import style from './CalculatorStage'

export default class CalculatorStage extends Component {
  static propTypes = {
    stage: PropTypes.string.isRequired
  }

  render() {

    const { stage } = this.props

    return (
      <div className={style.CalculatorStage}>
        <div className={style.CalculatorStage__countStagesSide}></div>
        <div className={style.CalculatorStage__contentSide}>{ stage }</div>
      </div>
    )
  }
}
